def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    edges = [tuple(map(int, line.split())) for line in stdin.split('\n')[1:-1]]

    def dfs(node, visited, path, paths):
        visited[node] = True
        path.append(node)
        for neighbor in range(1, n + 1):
            if not visited[neighbor] and (node, neighbor) in edges or (neighbor, node) in edges:
                dfs(neighbor, visited, path, paths)
        if len(path) > 1:
            paths.append(path[:])
        path.pop()
        visited[node] = False

    max_edges = 0
    a, b, c = -1, -1, -1
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            visited = [False] * (n + 1)
            path_a = []
            path_b = []
            paths = []
            dfs(i, visited, path_a, paths)
            dfs(j, visited, path_b, paths)
            for path in paths:
                edges_count = 0
                for edge in edges:
                    if edge[0] in path and edge[1] in path:
                        edges_count += 1
                max_edges = max(max_edges, edges_count)
            if max_edges == edges_count:
                a, b, c = i, j, -1
            if max_edges == edges_count and (a, b, c) != (-1, -1, -1):
                a, b, c = i, j, max(i, j)

    return f"{max_edges}\n{a} {b} {c}"

