    # Initialize the graph
    graph = [[0 for _ in range(n)] for _ in range(n)]

    # Fill in the graph
    for i, friend_pref in enumerate(friend_prefs):
        if friend_pref > 0:
            graph[i][friend_pref - 1] = 1

    # Helper function to find the next empty position in the graph
    def find_empty(row: List[int]) -> int:
        return row.index(0)

    # Helper function to find the next empty row in the graph
    def find_empty_row() -> int:
        for i, row in enumerate(graph):
            if 0 in row:
                return i
        return -1

    # Main loop to fill in the graph
    while find_empty_row() != -1:
        # Find the next empty row
        empty_row_index = find_empty_row()

        # Find the next empty position in the empty row
        empty_pos_index = find_empty(graph[empty_row_index])

        # Set the empty position to 1
        graph[empty_row_index][empty_pos_index] = 1

        # Propagate the change to the graph
        for i, row in enumerate(graph):
            if row[empty_row_index] == 1 and graph[i][empty_pos_index] == 0:
                graph[i][empty_pos_index] = 1

    # Convert the graph to the final output format
    output = []
    for i, row in enumerate(graph):
        if 1 in row:
            output.append(i + 1)
        else:
            output.append(0)

    return ' '.join(map(str, output))

