            return 0
        mod = 10**y
        remainder = 0
        for i in range(x, len(digits)):
            remainder = (remainder * 2 + digits[i]) % mod
        return remainder

    current_remainder = count_remainder(digits, 0, x)
    target_remainder = current_remainder - current_remainder % 10**y

    if target_remainder < 0:
        target_remainder += 10**x

    if current_remainder == target_remainder:
        return 0

    operations = 0
    for i in range(x, len(digits)):
        if digits[i] == (target_remainder // 10**(i - x)) % 2:
            digits[i] = 1 - digits[i]
            current_remainder = (current_remainder - target_remainder) % 10**x
            if current_remainder == target_remainder:
                return operations + 1
        operations += 1

    return -1  # This should never happen

