def solution(stdin: str) -> str:
    n, k = map(int, stdin.split())
    s = list(input())
    subs = set()

    def backtrack(start, length):
        if length > k:
            return
        if start >= n:
            return
        if s[start] not in subs:
            subs.add(s[start])
            backtrack(start + 1, length + 1)
            subs.remove(s[start])
        backtrack(start + 1, length)

    backtrack(0, 0)

    if len(subs) != k:
        return -1

    cost = 0
    for sub in subs:
        cost += n - len(sub)

    return str(cost)

