        for i in range(n - 2):
            if seq[i] != seq[i + 2]:
                return False
        return True

    def count_slash(seq: list) -> int:
        count = 0
        for i in range(n - 1):
            if seq[i] == seq[i + 1]:
                count += 1
        return count

    def min_replace(seq: list) -> int:
        if is_slash(seq):
            return 0

        max_slash_count = 0
        min_replace_count = n

        for i in range(n):
            for j in range(i + 1, n):
                if seq[i] != seq[j]:
                    seq[i], seq[j] = seq[j], seq[i]
                    slash_count = count_slash(seq)
                    if slash_count > max_slash_count:
                        max_slash_count = slash_count
                        min_replace_count = max(min_replace_count, 2 - slash_count)
                    seq[i], seq[j] = seq[j], seq[i]

        return min_replace_count

