    special_offers = []

    for _ in range(m):
        x, y = map(int, stdin.readline().split())
        special_offers.append((x, y))

    def binary_search(target: int) -> int:
        left, right = 0, len(shovels) - 1
        while left <= right:
            mid = (left + right) // 2
            if shovels[mid] == target:
                return mid
            elif shovels[mid] < target:
                left = mid + 1
            else:
                right = mid - 1
        return right + 1

    def find_cheapest(count: int) -> int:
        total_cost = 0
        for offer in special_offers:
            x, y = offer
            if x <= count:
                index = binary_search(shovels[y - 1])
                total_cost += sum(shovels[:index])
                shovels = shovels[index:]
                count -= x
        total_cost += sum(shovels[:count])
        return total_cost

    min_cost = float('inf')
    for count in range(1, k + 1):
        min_cost = min(min_cost, find_cheapest(count))

    return str(min_cost)


