    lines = stdin.split('\n')
    N = int(lines[0])
    A = list(map(int, lines[1].split()))
    B = list(map(int, lines[2].split()))
    C = list(map(int, lines[3].split()))

    upper = [(i, A[i]) for i in range(N)]
    middle = [(i, B[i]) for i in range(N)]
    lower = [(i, C[i]) for i in range(N)]

    def merge_sort(arr: List[Tuple[int, int]]) -> List[Tuple[int, int]]:
        if len(arr) <= 1:
            return arr
        mid = len(arr) // 2
        left = merge_sort(arr[:mid])
        right = merge_sort(arr[mid:])
        return merge(left, right)

    def merge(left: List[Tuple[int, int]], right: List[Tuple[int, int]]) -> List[Tuple[int, int]]:
        result = []
        i = j = 0
        while i < len(left) and j < len(right):
            if left[i][1] < right[j][1]:
                result.append(left[i])
                i += 1
            else:
                result.append(right[j])
                j += 1
        result += left[i:]
        result += right[j:]
        return result

    upper = merge_sort(upper)
    middle = merge_sort(middle)
    lower = merge_sort(lower)

    count = 0
    for i in range(len(upper)):
        for j in range(i + 1, len(middle)):
            for k in range(j + 1, len(lower)):
                if upper[i][1] < middle[j][1] and middle[j][1] < lower[k][1]:
                    count += 1

    return str(count)

