        for i in range(len(head) - 1):
            tail = tail.next

        cycle_node = linked_list
        for i in range(pos):
            cycle_node = cycle_node.next

        tail.next = cycle_node

    has_cycle_result = has_cycle(linked_list)

    return str(has_cycle_result).lower()

