def solution(stdin: str) -> str:
    n, k = map(int, input().split())
    matrix = []
    for _ in range(n):
        matrix.append(list(map(int, input().split())))

    manhattan_distance = lambda x1, y1, x2, y2: abs(x1 - x2) + abs(y1 - y2)

    def is_valid_move(x, y, k):
        if 0 <= x < n and 0 <= y < n:
            if matrix[x][y] == k:
                return True
        return False

    def bfs(start_x, start_y, end_x, end_y):
        queue = [(start_x, start_y, 0)]
        visited = set()
        while queue:
            x, y, distance = queue.pop(0)
            if (x, y) not in visited:
                visited.add((x, y))
                if x == end_x and y == end_y:
                    return distance + manhattan_distance(x, y, end_x, end_y)
                if is_valid_move(x + 1, y, k):
                    queue.append((x + 1, y, distance + 1))
                if is_valid_move(x - 1, y, k):
                    queue.append((x - 1, y, distance + 1))
                if is_valid_move(x, y + 1, k):
                    queue.append((x, y + 1, distance + 1))
                if is_valid_move(x, y - 1, k):
                    queue.append((x, y - 1, distance + 1))
        return -1

    start_x, start_y = -1, -1
    end_x, end_y = -1, -1

    for i in range(n):
        for j in range(n):
            if matrix[i][j] == 1:
                start_x, start_y = i, j
            if matrix[i][j] == k:
                end_x, end_y = i, j

    return str(bfs(start_x, start_y, end_x, end_y))

